- input: "TEXT\x1CC00019331\x1CX0\x1C\x1CF3XA\x1C(A1) This amendment responds to the
    Commission's request for additional information of September 10, 2010; payroll
    expenses for certain employees are reclassified on line 30(b). (1) Payroll-related
    items on Schedule H4 of this report were for employees that spent 25% or less
    of their compensated time on Federal activity. (2) Any receipts on lines 15 or
    17 were assessed at the usual and normal charge. (3) Any fundraising expenses
    on line 21b were for the benefit of the committee and did not support a federal
    candidate. (4) Receipts on Schedule A supporting line 11c from unregistered committees
    Friends of Mike Sheridan, Friends of Russ Decker, and Plunkett for Assembly have
    been deemed permissible. These contributions were made by non-Federal candidates
    that had the required funds from Federally-permissible sources. The funds were
    verified to have come from permissible sources and no amount exceeded the $1,000
    threshold that would require the committees to register with the Commission. (5)
    Schedule D includes the adjustment to zero of a debt of $671.75 reported as owed
    by the committee to Wells Print and Digital. The reported debt was a duplicate
    entry made in error. The service provided was originally billed at $671.75, but
    the vendor applied a credit of $39.11 for a balance of $632.64; it was correctly
    reported as a debt on the committee's 2009 year-end report, and paid on 3/23/10
    as reported on the April monthly report.\n"
